import { Fragment, useEffect, useState } from "react";
import classes from "./FetchData.module.css";

const FetchData = () => {
    const[isData,setIsData]=useState([])

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users").then((respose) => {
      return respose.json()
    }).then((data) => {
        let info = data.map((item)=>{
            return{
                name: item.name,
                username: item.username,
                email: item.email,
                phone: item.phone
            }
        })
        setIsData(info)
      });
  },[]);

  return (
    <Fragment>
      <section className={classes.section}>
        <input type="text" placeholder="Search" className={classes.input} />
      </section>
      <section>
        <table>
            <thead>
                <th>Name</th>
                <th>Username</th>
                <th>Email</th>
                <th>Mobile</th>
            </thead>
            <tbody>
                <td>{isData.name}</td>
                <td>{isData.username}</td>
                <td>{isData.email}</td>
                <td>{isData.phone}</td>
            </tbody>
        </table>

      </section>

    </Fragment>
  );
};
export default FetchData;
